from typing import List
import math


class Solution:
    def visiblePoints(self, points: List[List[int]], angle: int, location: List[int]) -> int:
        """
        https://stackoverflow.com/questions/42258637/how-to-know-the-angle-between-two-points
        """
        max_count = 0
        x, y = location[0], location[1]
        for center_point in points:
            count_a = 0
            count_b = 0
            center_degree = math.degrees(math.atan2(
                center_point[1] - y, center_point[0] - x))
            # print(center_degree - angle, center_degree, center_degree + angle)
            if center_degree < 0:
                center_degree += 360
            # print(center_degree - angle, center_degree, center_degree + angle) # center_degree + angle might be > 360
            for point in points:
                degree = math.degrees(math.atan2(point[1] - y, point[0] - x))

                if point == location:
                    count_a += 1
                    count_b += 1
                    continue

                # print(point, degree, end=' ')
                if center_degree + angle >= degree >= center_degree or center_degree + angle >= degree + 360 >= center_degree:
                    # print('count a!', end='')
                    count_a += 1
                if center_degree >= degree >= center_degree - angle or center_degree >= degree + 360 >= center_degree - angle:
                    # print('count b!', end='')
                    count_b += 1
                # print()

            max_count = max(max_count, count_a, count_b)

        return max_count

